import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

function Header() {
        return (
          <header className="page-header">
            <h1>My Header</h1>
            <button className="login-button">Login</button>
          </header>
        );
      }
      
      export default Header;
